// Example Nav in App.js
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <div className="navbar">
      <Link to="/">Home</Link>
      <Link to="/login">Login</Link>
      <Link to="/admin">Admin Panel</Link>
    </div>
  );
}

export default Navbar;
